    def edit_text_changed(self): 
        p = None
        font = QtGui.QFont()
        font.setPointSize(10)
        font.setBold(True)
        font.setWeight(75)
        for i in  range(len(self.startPress)):
            if self.startPress[i].text() == '' or self.startTemp[i].text() == '' or self.endPress[i].text() == '' or self.endTemp[i].text() == '':
                pass
            else:
                try:
                    if validators.between(float(self.startPress[i].text()), min = 0, max = 4900):
                        self.startPress[i].setStyleSheet('background: lightgreen;')
                    else:
                        self.startPress[i].setStyleSheet('background: red;')
                        p = False
                except ValueError:
                    self.startPress[i].setStyleSheet('background: yellow;')
                    
                    p = False
                try:    
                    if validators.between(float(self.startTemp[i].text()), min = -40, max = 130):
                        self.startTemp[i].setStyleSheet('background: lightgreen;') 
                    else:
                        self.startTemp[i].setStyleSheet('background: red;')  
                        p = False
                except ValueError:
                    self.startTemp[i].setStyleSheet('background: yellow;')  
                    p = False
                try:
                    if validators.between(float(self.endPress[i].text()), min = 0, max = 4900):
                        self.endPress[i].setStyleSheet('background: lightgreen;')
                    else:
                        self.endPress[i].setStyleSheet('background: red;')
                        p = False
                except ValueError:
                    self.endPress[i].setStyleSheet('background: yellow;')
                    p = False
                try:
                    if validators.between(float(self.endTemp[i].text()), min = -40, max = 130):
                        self.endTemp[i].setStyleSheet('background: lightgreen;')  
                    else:    
                        self.endTemp[i].setStyleSheet('background: red;')  
                        p = False
                except ValueError:
                    self.endTemp[i].setStyleSheet('background: yellow;')  
                    p = False
                self.startPress[i].setFont(font)
                self.startPress[i].setAlignment(QtCore.Qt.AlignCenter)
                self.startTemp[i].setFont(font)
                self.startTemp[i].setAlignment(QtCore.Qt.AlignCenter)
                self.endPress[i].setFont(font)                
                self.endPress[i].setAlignment(QtCore.Qt.AlignCenter)
                self.endTemp[i].setFont(font)
                self.endTemp[i].setAlignment(QtCore.Qt.AlignCenter)
                
        try: 
            float(self.tank_volume.text())
            # self.tank_volume.font.setBold(True)
            self.tank_volume.setStyleSheet('background: white;')
        except ValueError:
            self.tank_volume.setStyleSheet('background: yellow;')
            p = False
        self.tank_volume.setFont(font)
        self.tank_volume.setAlignment(QtCore.Qt.AlignCenter)
        
        if p is None:
            self.calculate()   
        else:
            t = u"\u00b0"
            msg = QMessageBox()
            msg.setWindowTitle(" Warning ")
            msg.setText("In Yellow \nNumbers only. \n\nIn Red \nPressure must be between 0 PSIG to 4900 PSIG \n\nTemperature must be between -40" +t+"F to 130" +t+"F")
            msg.exec_()
    
    def calculate(self):
        totalDelivered = 0
        for i in range(len(self.startPress)):
            
            if self.startPress[i].text() == '' or self.startTemp[i].text() == '' or self.endPress[i].text() == '' or self.endTemp[i].text() == '':
                pass
            else:
               
               start_sol = self.interpolate_beginning(float(self.startPress[i].text()), float(self.startTemp[i].text()))
               end_sol = self.interpolate_ending(float(self.endPress[i].text()), float(self.endTemp[i].text()))
               ft3Delivered = end_sol*float(self.tank_volume.text())-start_sol*float(self.tank_volume.text())
               self.CUFT[i].setText(str(round(ft3Delivered,3)))
               
               totalDelivered = round(totalDelivered + float(self.CUFT[i].text()),4)
               self.label_cuftDelivered.setText(str(totalDelivered))
           
        self.label_meter3Delivered.setText(str(round(totalDelivered*0.0283168,3)))
           
    def calculateLeak(self):
        if self.line_Tank1_start_2.text() == '' or self.line_Temp1_start_2.text() == '' or self.line_Tank1_end_2.text() == '' or self.line_Temp1_end_2.text() == '':
            pass
        else:   
            start_sol = self.interpolate_beginning(float(self.line_Temp1_start_2.text()), float(self.line_Temp1_start_2.text()))
            end_sol = self.interpolate_ending(float(self.line_Tank1_end_2.text()), float(self.line_Temp1_end_2.text()))
            leakft3 =abs(end_sol*float(self.tank_volume.text())-start_sol*float(self.tank_volume.text()))
            self.label_cuftDelivered_2.setText(str(round(leakft3,3)))
            self.label_meter3Delivered_2.setText(str(round(float(self.label_cuftDelivered_2.text())*0.0283168,3)))
    
    def checkODBC(self):
        if 'ODBC Driver 17 for SQL Server' in pyodbc.drivers():
            pass
        else:
            version = struct.calcsize("P")*8 
            msgBox = QMessageBox()
            msgBox.setWindowTitle("Software Needed: Microsoft ODBC Driver 17 for SQL Server          ")
            msgBox.setTextFormat(QtCore.Qt.RichText)#   //this is what makes the links clickable
            msgBox.setText("<b>Microsoft ODBC Driver 17 for SQL Server</b><br><br><a href='https://learn.microsoft.com/en-us/sql/connect/odbc/download-odbc-driver-for-sql-server?view=sql-server-ver16'>Operating System is "+str(version)+", use this Hyperlink</a>")
            msgBox.exec()
    
